/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
 var missingElement = function(nums, k) {
    var map = {}
    for(var i = 0; i<nums.length;i++){
        map[nums[i]] = true;
    }
    var totalMissing = nums[nums.length-1] - (nums[0]+nums.length) + 1 ;
    if(k>totalMissing){
        k = k-totalMissing;
        return nums[nums.length-1] + k;
    }
    //var missing = [];
    var count = nums[0];
    var missing = -Infinity;
    var mssingCount = 0;
    while(mssingCount<k){
        if(!map[count]){
            mssingCount++;
            missing = count;
        }
        count++;
    }
    return missing;
};

